CREATE DEFINER=`root`@`localhost` PROCEDURE `ObtenerClasificacionFil` (IN `newtipo` VARCHAR(50), IN `newcateg` VARCHAR(50), IN `newpais` VARCHAR(50), IN `newduracion` INT, IN `newactor` VARCHAR(50), IN `newfechaI` YEAR, IN `newfechaF` YEAR)  NO SQL
BEGIN
	START TRANSACTION;
/*IF SOLO FECHAS */
	IF newfechaI IS NOT NULL AND newfechaF IS NOT null AND newduracion IS NULL  AND newactor IS null OR newactor = '' THEN 
		SELECT clasificacion AS 'name',COUNT(clasificacion) AS 'value' 
        FROM   titulos
        WHERE tipo = newtipo AND categoria = newcateg AND pais = newpais  AND duracion >= newduracion and fecha BETWEEN newfechaI AND newfechaF 
        GROUP BY clasificacion;
/*IF FECHAS Y ACTOR */ 
	ELSEIF newfechaI IS NOT NULL AND newfechaF IS NOT null AND newduracion IS NULL AND newactor IS NOT null THEN 
		SELECT clasificacion AS 'name',COUNT(clasificacion) AS 'value' 
        FROM   titulos
        WHERE tipo = newtipo AND categoria = newcateg AND pais = newpais  AND elenco LIKE CONCAT('%', newactor, '%') AND duracion >= newduracion AND fecha BETWEEN newfechaI AND newfechaF
        GROUP BY clasificacion;
/*IF FECHAS Y DURACION */ 
	ELSEIF newfechaI IS NOT NULL AND newfechaF IS NOT null AND newduracion IS NOT NULL  AND newactor IS null THEN 
    	SELECT titulo from titulos where duracion =10;
		SELECT clasificacion AS 'name',COUNT(clasificacion) AS 'value' 
        FROM   titulos
        WHERE tipo = newtipo AND categoria = newcateg AND pais = newpais  AND duracion >= newduracion AND fecha BETWEEN newfechaI AND newfechaF
        GROUP BY clasificacion;        
 /*IF NADA vacio*/        
    ELSEIF newduracion IS NOT NULL  AND newactor IS NOT null OR newactor != ''  AND newfechaI IS NOT NULL AND newfechaF IS NOT null THEN  
        SELECT clasificacion AS 'name',COUNT(clasificacion) AS 'value' 
        FROM   titulos
        WHERE tipo = newtipo AND categoria = newcateg AND pais = newpais 
        AND elenco LIKE CONCAT('%', newactor, '%') AND  duracion >= newduracion AND fecha BETWEEN newfechaI AND newfechaF
        GROUP BY clasificacion; 

    ELSE
    	SELECT clasificacion  AS 'name' ,COUNT(clasificacion) AS 'value' 
        FROM   titulos 
        WHERE tipo = newtipo
        GROUP BY clasificacion;
        

        
    END IF;    
    COMMIT;
    
    
END$$

