CREATE DEFINER=`root`@`localhost` PROCEDURE `ObtenerTituloYear` (IN `newtipo` VARCHAR(50), IN `newcateg` VARCHAR(50), IN `newpais` VARCHAR(50), IN `newduracion` INT(11), IN `newactor` VARCHAR(50), IN `newfecha` YEAR)  NO SQL
BEGIN
	START TRANSACTION;
    /*IF duracion vacio*/
    IF newduracion IS NULL  AND newactor IS NOT null  and newfecha is not null THEN 
        SELECT titulo AS 'name', descripcion
        FROM   titulos
        WHERE tipo = newtipo AND categoria = newcateg AND pais = newpais AND elenco LIKE CONCAT('%', newactor, '%') AND fecha = newfecha and duracion >= newduracion;
        
