        SELECT titulo AS 'name', descripcion
        FROM   titulos
        WHERE tipo = newtipo AND categoria = newcateg AND pais = newpais AND duracion >= newduracion AND fecha = newfecha;
/*IF solo tipo categ y pais*/ 
    ELSEIF newduracion IS NOT NULL AND newactor IS null OR newactor = '' and newfecha is not null THEN  
        SELECT titulo AS 'name', descripcion
        FROM   titulos
        WHERE tipo = newtipo AND categoria = newcateg AND pais = newpais  AND fecha = newfecha AND duracion >= newduracion;
    ELSE
